import React from 'react';

const Affordable = () => {
    return (
        <div >
            <div className="text-center">
                <h1 className="text-4xl font-bold text-teal-500">
                    Affordable Pricing
                </h1>
            </div>
        </div>
    );
};

export default Affordable;
